const Part = (props) => {
    return <p>{props.key} {props.exercises}</p>
}

const Header = (props) => {
    return <h1>{props.course}</h1>
}

const Content = (props) => {
    let myKeys = [];
    props.content.forEach((value, key) => myKeys.push(key));

    return (
        <>
            {myKeys.map((key) => <Part key={key} exercises={props.content.get(key)} />)}
        </>
    )
}

const Total = (props) => {
    return <p>Number of exercises {props.sum}</p>
}


